            strength = 'weak';
        }

        return strength;

    };

    const testPasswError = passw => {

        const errorSymbols = /\s/g;

        return testPasswRegexp(passw, errorSymbols);

    };

    const setStrengthBarValue = (bar, strength) => {

        let strengthValue;

        switch (strength) {
            case 'weak':
                strengthValue = 25;
                bar.setAttribute('aria-valuenow', strengthValue);
                break;

            case 'moderate':
                strengthValue = 50;
                bar.setAttribute('aria-valuenow', strengthValue);
                break;

            case 'strong':
                strengthValue = 75;
                bar.setAttribute('aria-valuenow', strengthValue);
                break;

            case 'extra':
                strengthValue = 100;
                bar.setAttribute('aria-valuenow', strengthValue);
                break;

            default:
                strengthV");
